text:
{'text': 'We came to Beng Hiang for a team lunch because they had vegetarian options and lohei. While the lohei was served promptly at 12, the rest of the meal was a disaster in terms of timing‚Äîwe waited a staggering 1 hour and 30 minutes for the next dish to arrive. Despite multiple reminders to the staff, nothing changed. To make things worse, the rice was served early, so by the time the rest of the food arrived, it was cold.

As for the food itself, it was pretty average. The only standout was the roasted chicken, which was well-seasoned and flavorful. The vegetables, on the other hand, were coarsely cut into large, uneven chunks, making them difficult to eat. The wu xiang was bland and barely marinated.

The long wait really soured the experience. While the staff were still polite, the service was way too slow. I wouldn‚Äôt recommend coming here again. 5/10.', 'languageCode': 'en'}

